import React from 'react';

function FAQ() {
  return (
    <div>
      <h2 className="text-xl font-bold mb-2">Frequently Asked Questions</h2>
      <ul className="list-disc ml-6">
        <li>What is the preparation for an MRI?</li>
        <li>How long does an X-ray take?</li>
        <li>Can I book appointments online?</li>
      </ul>
    </div>
  );
}

export default FAQ;
